import mc from "./nav-bar-left.module.scss";
import { useState } from "react";

const NavBarLeft = () => {
  const [navHide, setNavHide] = useState(false);
  console.log(navHide);

  return (
    <div
      className={
        navHide
          ? `${mc.hideNavBar} ${mc.container}`
          : `${mc.container} ${mc.containerShow}`
      }
    >
      <div className={mc.rubrics_container}>
        <button onClick={() => setNavHide(!navHide)}>
          {navHide ? (
            <i class="icon-arrow-forward-outline"></i>
          ) : (
            <i className="icon-arrow-back-outline"></i>
          )}
        </button>
        <div>
          <h2>Cinema</h2>
          <p>Les sorties</p>
        </div>
        <div>
          <h2>Vod</h2>
          <h3>Netflix</h3>
          <p>A venir</p>
          <h3>Amazon Prime</h3>
          <p>A venir</p>
          <h3>Disney+</h3>
          <p>A venir</p>
        </div>
        <div>
          <h2>Gaming</h2>
          <h3>PC</h3>
          <h3>PS5</h3>
          <h3>Xbox</h3>
          <h3>Nintendo Switch</h3>
        </div>
      </div>
    </div>
  );
};

export default NavBarLeft;
